function DataFetching() {
  const [sneaker, setSneaker] = useState( [] );

  useEffect(() => {
    fetch("localhost:3001/api/")
      .then(res => setSneakers(res.data))
}, [])

return (
  <div>
    <ul>
      {
        sneakers.map(data => <li key={sneaker.id}> {sneakers.name} </li>)
      }
    </ul>
  </div>
)

}

